import axios from "axios"
import homeImage from '../src/static/loginHome.jpeg'
import React from "react";
function App() {

  let testing = async() =>{
    // const result = await Axios.get("http://127.0.0.1:8000/api/home/5", 
    //   { Headers: {
    //     'Authorization': "token 5f1beddc2b0ed77c6980b4a113d740c47b548440",
    //     'Content-Type': 'text/plain', }
    //   });
    // console.log(result.data)

    // var axios = require('axios');

  var config = {
  method: 'get',
  url: 'http://127.0.0.1:8000/api/home/',
  headers: { 
    'Authorization': 'token 5f1beddc2b0ed77c6980b4a113d740c47b548440'
  }
};

axios(config)
.then(function (response) {
  // console.log(response.data[0]['username']);
  document.getElementById(12).innerHTML = response.data[0]['username']
})
.catch(function (error) {
  console.log(error);
});




  }
  return (
    <div className="container">
      <img src={homeImage} alt="login" className="login-form-image"/>
      <form className="input-form">
        <p className="login-header"> Login into the world of table tennis</p> <br />
        <label>Email Id: <input type="text" className="login-form-input"/></label><br /><br />
        <label>Password: <input type="text" className="login-form-input"/></label><br /><br />
        <input type="checkbox" id="remember" />
        <label> Remember me</label>
        <p className="login-forget-password" id="12"> Forget Password?</p>
        <button type="submit" className="login-submit-button" onClick={testing}>Login</button>

      </form> 


    </div>
  );
}

export default App;
